import Header from "./Header";
import AsideGuest from "./AsideGuest";
import AsideLogged from "./AsideLogged";
import Content from "./Content";
import Footer from "./Footer";

const Home = (props) => {
  return (
    <>
      <Header />
      <div class="row">
        <div class="col-1.5">
          <AsideGuest />
        </div>
        <div class="col-10">
          <Content />
        </div>
      </div>
    </>
  );
};

export default Home;
